// src/api/order.js
import axios from 'axios'

const BASE_URL = 'http://localhost:9090'

export function initOrder() {
  return axios.get(`${BASE_URL}/orders`)
}

export function confirmOrder(orderData) {
  return axios.post(`${BASE_URL}/orders`, orderData)
}

export function getOrderById(id) {
  return axios.get(`${BASE_URL}/orders/${id}`)
}

export function getOrdersByUsername(username) {
  return axios.get(`${BASE_URL}/users/orders`, { params: { username } })
}
